import styled from "styled-components";

export const Container = styled.a`
    display: flex;
    align-items: center;
    justify-content: center;

    height: 30px;
    width: 30px;

    padding: 5px;


    border-radius: 100%;
`;

export const Image = styled.img`
    width: 30px;
    height: 30px;

`;
